	@Inject
	public AfvlGrammarAccess(GrammarProvider grammarProvider,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pFunctionalView = new FunctionalViewElements();
		this.pConnector = new ConnectorElements();
		this.pComponent = new ComponentElements();
		this.pEString = new EStringElements();
		this.pEInt = new EIntElements();
		this.pPort = new PortElements();
		this.pRole = new RoleElements();
		this.eDeliveryModel = new DeliveryModelElements();
		this.eSyncType = new SyncTypeElements();
		this.ePortType = new PortTypeElements();
		this.eRoleType = new RoleTypeElements();
		this.eNotificationModel = new NotificationModelElements();
		this.eBuffering = new BufferingElements();
		this.eThroughput = new ThroughputElements();
		this.pStream = new StreamElements();
		this.pAdaptor = new AdaptorElements();
		this.pDistributor = new DistributorElements();
		this.pEvent = new EventElements();
		this.pProcedureCall = new ProcedureCallElements();
		this.eProcessingModel = new ProcessingModelElements();
		this.eAccessType = new AccessTypeElements();
		this.pTransformer = new TransformerElements();
		this.pEstimator = new EstimatorElements();
		this.pIngestor = new IngestorElements();
		this.pSink = new SinkElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("co.edu.uniandes.accordant_fv.Afvl".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
	public TerminalsGrammarAccess getTerminalsGrammarAccess() {
		return gaTerminals;
	}

	
